func IsEmoji(text string) bool {
	if len(text) == 0 {
		return false
	}
	if _, ok := emojiMap[text]; ok {
		return true
	}
	return false
}

func GetEmojiImage(text string) (image.Image, bool) {
	if len(text) == 0 {
		return nil, false
	}
	if fileName, ok := emojiMap[text]; ok {
		file, err := emojiPng.ReadFile(fmt.Sprintf("emoji/%s.png", fileName))
		if err != nil {
			return nil, false
		}
		if decode, _, err := image.Decode(bytes.NewBuffer(file)); err == nil {
			return decode, true
		}
	}
	return nil, false
}
